import React from "react";
import "./crudStyle.css"
const ListInfo=(props)=>{



    return(
        <>
            <h1 className="center">List Des Stagiaires</h1>
            <button type="button">Ajouter Stagiaire</button>
            <div>
                {props.List.map((e)=>(
                    <div>
                        <img src={`/${e.image}`} alt="photo"></img>
                        <h4>id : {e.id}</h4>
                        <p>Prenom : {e.prenom} </p>
                        <p>Nom : {e.nom} </p>
                        <p>Email : {e.email}</p>
                    </div>)
                )}

            </div>
        
        </>


    )




}
export default ListInfo
